import VideoCard from './VideoCard'

const Videos = ({videos}) => {
  console.log(videos);
  return (
    <div direction="row" style={{flexWrap:"wrap", justifyContent:"center", alignItems:"start"}}>
      {videos.map((item, idx) => (
        <div style={{width: '480px', height: '360px', marginLeft: '8px', marginRight: '8px', display:'inline-flex'}} key={idx}>
          {item.id.videoId && <VideoCard video={item} /> }
        </div>
      ))}
    </div>
  )
}

export default Videos
